import React from 'react';
import EmployeeList from '../EmployeeList/EmployeeList';


const Dashboard = ({ user, onLogout, admins, employees }) => {
  return (
    <div>
      <h1>Dashboard</h1>
      <button onClick={onLogout}>Logout</button>

      <EmployeeList employees={employees} />

      {user.role === 'client' && (
        <>
          <h2>Admins</h2>
          <ul>
            {admins.map((admin) => (
              <li key={admin._id}>{`${admin.nom} ${admin.postNom} ${admin.preNom}`}</li>
            ))}
          </ul>
        </>
      )}
    </div>
  );
};

export default Dashboard;
